import React, { useEffect } from 'react';
import './About.css';

const About = () => {
  const skills = [
    { name: 'React', level: 90 },
    { name: 'JavaScript', level: 85 },
    { name: 'CSS/SCSS', level: 80 },
    { name: 'UI/UX Design', level: 75 },
    { name: 'Node.js', level: 70 },
  ];

  useEffect(() => {
    // تنشيط أشرطة المهارات عند التمرير
    const skillBars = document.querySelectorAll('.skill-level');
    
    const animateOnScroll = () => {
      skillBars.forEach(bar => {
        const barPosition = bar.getBoundingClientRect().top;
        const screenPosition = window.innerHeight * 0.8;
        
        if (barPosition < screenPosition) {
          const width = bar.parentElement.getAttribute('data-level');
          bar.style.width = width;
        }
      });
    };

    window.addEventListener('scroll', animateOnScroll);
    return () => window.removeEventListener('scroll', animateOnScroll);
  }, []);

  return (
    <section id="about" className="about-section">
      <div className="container">
        <div className="about-content">
          <h2 className="section-title">
            <span className="title-number">01.</span> عني
          </h2>
          
          <div className="about-grid">
            <div className="about-text">
              <p>
                مرحباً! أنا <span className="highlight">[اسمك]</span>، مطور واجهات أمامية متخصص في بناء تجارب ويب تفاعلية وجذابة.
              </p>
              <p>
                لدي خبرة تزيد عن [X] سنوات في تطوير تطبيقات ويب حديثة باستخدام تقنيات مثل React.js وJavaScript. أساعد الشركات في تحويل أفكارهم إلى منتجات رقمية عالية الجودة.
              </p>
              <p>
                عندما لا أكون أمام الكمبيوتر، يمكنك أن تجدني أتعلم تقنيات جديدة، أو أساهم في مشاريع مفتوحة المصدر، أو أستكشف عالم التصميم الرقمي.
              </p>
              
              <div className="tech-stack">
                <h3>التقنيات التي أستخدمها:</h3>
                <ul>
                  <li>React.js</li>
                  <li>Next.js</li>
                  <li>TypeScript</li>
                  <li>Tailwind CSS</li>
                  <li>Figma</li>
                </ul>
              </div>
            </div>
            
            <div className="about-image">
              <div className="image-wrapper">
                <img 
                  src="/profile.jpg" 
                  alt="[اسمك]" 
                  className="profile-image"
                />
                <div className="image-border"></div>
              </div>
              
              <div className="skills-chart">
                {skills.map((skill, index) => (
                  <div key={index} className="skill-item">
                    <span className="skill-name">{skill.name}</span>
                    <div 
                      className="skill-bar" 
                      data-level={`${skill.level}%`}
                    >
                      <div 
                        className="skill-level"
                        style={{ width: '0%' }} // سيتم تعديله بالجافاسكريبت
                      ></div>
                    </div>
                    <span className="skill-percent">{skill.level}%</span>
                  </div>
                ))}
              </div>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default About;
